const ScheduleTableRow = (props) => {
  const { sv } = props;

  return (
    <tr>
      <td>{sv.leagueName}</td>
      <td>{sv.matchDate}</td>
      <td>{sv.matchTime}</td>
      <td>{sv.matchPlace}</td>
      <td>{sv.teamAName}</td>
      <td>{sv.teamAPoint}</td>
      <td>{sv.teamBPoint}</td>
      <td>{sv.teamBName}</td>
      <td>{sv.matchContent}</td>
    </tr>
  );
};

export default ScheduleTableRow;
